(162, 'India', '', 0, 1, '<p>\r\n	<strong><span style=\"background-color:#ffffe0;\">Visa has operations across all continents worldwide with the exception of </span><a href=\"https://en.wikipedia.org/wiki/Antarctica\" title=\"Antarctica\"><span style=\"background-color:#ffffe0;\">Antarctica</span></a><span style=\"background-color:#ffffe0;\">. </span><a class=\"mw-redirect\" href=\"https://en.wikipedia.org/wiki/Visa_Europe\" title=\"Visa Europe\"><span style=\"background-color:#ffffe0;\">Visa Europe</span></a><span style=\"background-color:#ffffe0;\"> is a separate membership entity that is an exclusive licensee of Visa Inc.&#39;s trademarks and technology in the European region, issuing cards such as </span><a href=\"https://en.wikipedia.org/wiki/Visa_Debit\" title=\"Visa Debit\"><span style=\"background-color:#ffffe0;\">Visa Debit</span></a><span style=\"background-color:#ffffe0;\"> and Visa Credit.</span></strong></p>\r\n', '', '<ol class=\"_kYe\">\r\n	<li class=\"_AXc\">\r\n		<span style=\"background-color:yellow;\"><span style=\"font-size: 16px;\">Appointment Letter received from the NVC.</span></span></li>\r\n	<li class=\"_AXc\">\r\n		<span style=\"background-color:yellow;\"><span style=\"font-size: 16px;\">Passport(s) valid for six months beyond the intended date of entry into the United States.</span></span></li>\r\n	<li class=\"_AXc\">\r\n		<span style=\"background-color:yellow;\"><span style=\"font-size: 16px;\">Police Certificate(s)</span></span></li>\r\n	<li class=\"_AXc\">\r\n		<span style=\"background-color:yellow;\"><span style=\"font-size: 16px;\">Birth Certificate(s)</span></span></li>\r\n	<li class=\"_AXc\">\r\n		<span style=\"background-color:yellow;\"><span style=\"font-size: 16px;\">Court and prison records, if applicable.</span></span></li>\r\n	<li class=\"_AXc\">\r\n		<span style=\"background-color:yellow;\"><span style=\"font-size: 16px;\">Military records, if applicable.</span></span></li>\r\n</ol>\r\n', '', '91', '00'),
