(21, 'Sales Coordinator/Engineer Massaed  -[Assigned to Consultant Joicy ]', '2017-11-26', '2017-11-27', 0, 0, 0, 0, 29, 28, 0, 0, 1, 1, 0, 0, 0, '<p>\n	Kindly source&nbsp; CV&rsquo;s <strong>(Pakistan/Indian Nationality)</strong> with same details below.</p>\n<p>\n	&nbsp;</p>\n<p>\n	Sales Engineer/Executive Details:</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Arabic &amp; English Speaking &amp; Writing[ IN CASE IF NOT GETTING TAKE WITHOUT THIS ]</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Experience in sales in UAE 1-5 Years.</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Engineering background/degree: Electrical/Mechanical with background in Civil.</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Positive if has 1 year in elevators industry.</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Currently residing in UAE.</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; UAE driving license.</p>\n<p style=\"margin-left:55.5pt;\">\n	&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Good experience in dealing with clients.</p>\n<p style=\"margin-left:55.5pt;\">\n	&nbsp;</p>\n<p style=\"margin-left:55.5pt;\">\n	<span style=\"background-color:#ffff00;\">Note : this is the same requirment as before but the nationality has been changed from Arabic to indian and pakistani [ just shortlist 3 resumes and send it back at the earliest ] [ try uploading the resumes in the RMS ]</span></p>\n', 0, 0, 0, 1),
(22, 'Client followup - Pending', '2017-11-26', '2017-11-30', 0, 0, 0, 0, 28, 29, 0, 0, 1, 1, 0, 0, 0, '<p>\n	<strong>CV- Feedback - Pending</strong></p>\n<div>\n	Eniprom<span style=\"white-space:pre\"> </span>Sales Manager - Arabic<span style=\"white-space:pre\"> </span></div>\n<div>\n	Eniprom<span style=\"white-space:pre\"> </span>Sales engineer</div>\n<div>\n	Media One hotel<span style=\"white-space:pre\"> </span>Outlet supervisor</div>\n<div>\n	Massaed<span style=\"white-space:pre\"> </span>Sales Engineer(Elevator)</div>\n<div>\n	Solas Marine<span style=\"white-space:pre\"> </span>Sales Engineer</div>\n<div>\n	Solas Marine<span style=\"white-space:pre\"> </span>Assistant Accountant</div>\n', 0, 0, 0, 0),
